pub fn vdupq_lane_s8<const N: i32>(a: int8x8_t) -> int8x16_t {
    static_assert_uimm_bits!(N, 3);
    unsafe {
        simd_shuffle!(
            a,
            a,
            [
                N as u32, N as u32, N as u32, N as u32, N as u32, N as u32, N as u32, N as u32,
                N as u32, N as u32, N as u32, N as u32, N as u32, N as u32, N as u32, N as u32
            ]
        )
    }
}
